import * as React from 'react'
import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Calendar from './Calendar';
function Schedule() {
    const [viewtype, setviewtype] = React.useState('Calendar');
    //const [viewtype] = React.useState('Calendar'); 
    return(
        <Box className='schedule'sx={{position: 'relative', top: '60px'}}>
            <Stack spacing={0} direction="row" sx={{alignItems:'center', width: '100vw'}}>
                <Button onClick={() => {
                setviewtype('List');
                }}>List</Button>
                <Button onClick={() => {
                setviewtype('Calendar');
                }}>Calendar</Button>
            </Stack>
            {viewtype === 'Calendar' ? (
            <Calendar/>
          ) : viewtype === 'List' ? (
            <div>HOLY SHIT I JUST HIT A CLIP</div>
          ) : null}
        </Box>
    );
}

export default Schedule;
